import React from 'react';
import 'antd/dist/antd.css';
import Proptypes from 'prop-types';

const reactBoard = ({ Component }) => (
  <>
    <div>공통메뉴</div>
    <Component />
  </>
);

reactBoard.propTypes = {
  Component: Proptypes.element.isRequired,
};
export default reactBoard;
